import "./App.css";
import Header from "./components/Header/Header";

function App() {
  fetch(
    "http://dataservice.accuweather.com/forecasts/v1/daily/5day/215854?apikey=vHpVFJikTtHFfeWGvUo8EqmhA5ZX7NAA"
  )
    .then((res) => {
      return res.json();
    })
    .then((res) => {
      console.log(res);
    });

  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
